import React from "react";

type MessageType = {
    text: string
    files: []
}
export function MessageList(props:MessageType){
    return <div>
        <ul>
            {props.files.map((message: MessageType) => (
                <li key={message.id}>
                    <div>
                        <h5>{message.userName}</h5>
                        <p>{message.message}</p>
                    </div>
                </li>
            ))}
        </ul>
    </div>
}
